	async function sendemail(mytext) {
	
await fetch("https://script.google.com/macros/s/AKfycbxx3Ez3t4UEoibQyhvIFe1N0iakcJUwLbd-o6awN5HboUz5kwKy/exec?type=sendEmail",{method:"POST","body":JSON.stringify({"Text":mytext})})

}
	
	async function send () {
		var images=document.querySelectorAll("img"); 
		var images2=[];
		for (var i=0;i<images.length;i++) {
			images2.push(images[i].src)
			}

			
			console.log(images2)
		var inputs=document.querySelectorAll(".myinput");var inputs2=[];for(var i=0;i<inputs.length;i++) {inputs2.push(inputs[i].value)}
		var results={};
		for (var i=0;i<images2.length;i++) {
			results[images2[i]]=inputs2[i]
		}
		console.log(results)
		var emailbody={};
		emailbody["request_from"]=document.querySelector(".input").value;
		emailbody["data"]=results;
		if (document.querySelector(".input").value!='') {
		await  sendemail(JSON.stringify(emailbody)).then(function(v){ alert("Your request has been sent! You'll receive an email when an NFT has been purchased on your behalf.")})
		}
	}
